import './App.css';
import './index.css';
import Navbar from './Navbar';
import Home from './Home';
import {BrowserRouter, Switch, Route} from 'react-router-dom';
function App() {
  return (
    <div className="bg-primary">
      <BrowserRouter>
      <Navbar />
      <Switch>
      <Home/>
      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
